    "Aquatic macroinvertebrate sampling at Fish Spring National Wildlife Refuge : Diverse
    needs for migratory, wintering and breeding waterfowl, wading birds, shorebirds
    and other priority species",nt"tracking_summary": {ntt"total": 1,ntt"recent":
    1nt},nt"groups": [],nt"relationships_as_subject": [],nt"revision_timestamp":
    "2016-07-27T23:05:39.666655",nt"name": "aquatic-macroinvertebrate-sampling-at-fish-spring-national-wildlife-refuge-diverse-needs-f",nt"isopen":
    false,nt"url": null,nt"notes": "This preliminary proposal is targeted to
    better understanding of how prescribed water management, including depth and duration,
    influence water quality, food production (i.e. aquatic macroinvertebrates) and habitat
    use by priority ROC throughout all seasons on Fish Springs National Wildlife Refuge.
    This proposed study has two components: (1) The first component will investigate
    the response of aquatic macroinvertebrate diversity and biomass to water level management
    in seasonal wetland habitat for development of HMP strategies, and (2) The second
    component is a descriptive study looking at targeted ROC species detection and non-detection
    site selection for foraging.",nt"license_title": "License Not Specified",nt"extras":
